import styled from "styled-components";
import "./App.css";
import { Button } from "react-bootstrap";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate
} from "react-router-dom";

const Title = styled.div`
  padding-top: 20px;
  padding-bottom: 20px;
  text-align: center;
  font-size: 60px;
  color: white;
  font-family: "Amatic SC", cursive;
`;

const NewTask = styled.div`
  text-align: center;
`;

const AllTasks = styled.div`
  text-align: center;
`;

const Completed = styled.div`
  display: grid;
  justify-comtent: center;
  color: white;
`;

function App() {
  return (
    <div className="App">
      <Title>Feladatok</Title>
      <Routes>
        <Completed>
          <Route path="/piac">
            <Route index element={<MarketTablePage />} />
            <Route path="uj" element={<NewMarket />} />
            <Route path="szerkeszt/:id" element={<EditMarket />} />
            <Route path="*" element={<Navigate to="/piac" replace />}></Route>
          </Route>
          <Route path="/uncompleted">
            <Button className="Uncompleted" variant="dark">
              Elvégzendő feladatok
            </Button>
          </Route>
          <Button className="Completed" variant="dark">
            Teljesített feladatok
          </Button>
          <Button className="All" variant="dark">
            Összes feladat
          </Button>
          <Button variant="dark">Feladat hozzáadása</Button>
        </Completed>
      </Routes>
    </div>
  );
}

export default App;
